import React from 'react';

import {ReactComponent as CatIcon} from '../../assets/icons/cat.svg';
import {ReactComponent as DogIcon} from '../../assets/icons/dog.svg';
import {ReactComponent as HorseIcon} from '../../assets/icons/horse.svg';

import './icon.styles.css';

const iconTypes = {
    Cat: CatIcon,
    Dog: DogIcon,
    Horse: HorseIcon
}


const IconComponent = ({type}) => {


    let Icon = iconTypes[type]

    return (
      <Icon className='animal-icon'/>  
    )
}

export default IconComponent;
